--
-- Table structure for table `curso_inscrito`
--

DROP TABLE IF EXISTS `curso_inscrito`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `curso_inscrito` (
  `Id_CursoInscrito` smallint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Número identificador de la relación usuario-curso',
  `Nivel_Actual` tinyint unsigned NOT NULL COMMENT 'Nivel del curso en el que se encuentra el usuario',
  `Fecha_Inicio` date NOT NULL COMMENT 'Fecha en que el usuario inició el curso',
  `Fecha_Reciente` date NOT NULL COMMENT 'Fecha más reciente en que el usuario subió de nivel',
  `Fecha_Fin` date DEFAULT NULL COMMENT 'Fecha en que el usuario finalizó el curso',
  `Calificacion` decimal(1,1) DEFAULT NULL COMMENT 'Calificación dada por el usuario al curso',
  `Comentario` varchar(255) DEFAULT NULL COMMENT 'Comentario del usuario con respecto al curso',
  `Diploma` longblob COMMENT 'Diploma obtenido por el usuario al finalizar el curso',
  `Pago_Total` decimal(10,2) NOT NULL COMMENT 'Cantidad total que pagó el usuario por el curso',
  `Forma_Pago` varchar(15) NOT NULL COMMENT 'Forma de pago que utilizó el usuario para el curso',
  `Id_Usuario` smallint unsigned NOT NULL COMMENT 'Relación con el número de usuario que se inscribió al curso',
  `Id_Curso` smallint unsigned NOT NULL COMMENT 'Relación con el número de curso al que fue inscrito el usuario',
  PRIMARY KEY (`Id_CursoInscrito`),
  KEY `FK_CI_US` (`Id_Usuario`),
  KEY `FK_CI_CUR` (`Id_Curso`),
  CONSTRAINT `FK_CI_CUR` FOREIGN KEY (`Id_Curso`) REFERENCES `curso` (`Id_Curso`),
  CONSTRAINT `FK_CI_US` FOREIGN KEY (`Id_Usuario`) REFERENCES `usuario` (`Id_Usuario`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

