DROP TABLE IF EXISTS `mensaje`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `mensaje` (
  `Id_Mensaje` smallint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Número identificador de mensaje',
  `Fecha_Hora` datetime NOT NULL COMMENT 'Fecha y hora en que fue enviado el mensaje',
  `Contenido` varchar(255) NOT NULL COMMENT 'Contenido del mensaje enviado',
  `Id_Usuario_E` smallint unsigned NOT NULL COMMENT 'Relación con el número de usuario (escuela) que recibe o envía el mensaje',
  `Id_Usuario_A` smallint unsigned NOT NULL COMMENT 'Relación con el número de usuario (alumno) que recibe o envía el mensaje',
  PRIMARY KEY (`Id_Mensaje`),
  KEY `FK_MEN_US_ESC` (`Id_Usuario_E`),
  KEY `FK_MEN_US_ALUM` (`Id_Usuario_A`),
  CONSTRAINT `FK_MEN_US_ALUM` FOREIGN KEY (`Id_Usuario_A`) REFERENCES `usuario` (`Id_Usuario`),
  CONSTRAINT `FK_MEN_US_ESC` FOREIGN KEY (`Id_Usuario_E`) REFERENCES `usuario` (`Id_Usuario`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
