DROP TABLE IF EXISTS `nivel`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `nivel` (
  `Id_Nivel` smallint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Número identificador de nivel',
  `Contenido` varchar(255) DEFAULT NULL COMMENT 'Contenido texto que tiene el nivel',
  `Imagen` longblob COMMENT 'Imagen relacionada al nivel',
  `Video` longblob NOT NULL COMMENT 'Video relacionado al nivel',
  `Archivos` longblob COMMENT 'Archivo adjunto relacionado al nivel',
  `Links` varchar(255) DEFAULT NULL COMMENT 'Link a página externa relacionada al nivel',
  `Costo` decimal(10,2) NOT NULL COMMENT 'Costo del nivel',
  `Id_Curso` smallint unsigned NOT NULL COMMENT 'Relación con el número de curso al que pertenece el nivel',
  PRIMARY KEY (`Id_Nivel`),
  KEY `FK_NIV_CUR` (`Id_Curso`),
  CONSTRAINT `FK_NIV_CUR` FOREIGN KEY (`Id_Curso`) REFERENCES `curso` (`Id_Curso`)
