--
-- Table structure for table `usuario`
--

DROP TABLE IF EXISTS `usuario`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `usuario` (
  `Id_Usuario` smallint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Número identificador de usuario',
  `Tipo` char(1) NOT NULL COMMENT 'Si el usuario es tipo escuela (E) o alumno (A)',
  `Nombre` varchar(30) NOT NULL COMMENT 'Nombre(s) del usuario',
  `Apellido_P` varchar(15) NOT NULL COMMENT 'Apellido paterno del usuario',
  `Apellido_M` varchar(15) NOT NULL COMMENT 'Apellido materno del usuario',
  `Genero` varchar(10) NOT NULL COMMENT 'Género del usuario',
  `Fecha_Nac` date NOT NULL COMMENT 'Fecha de nacimiento del usuario',
  `Foto` longblob NOT NULL COMMENT 'Imagen de perfil del usuario',
  `Email` varchar(40) NOT NULL COMMENT 'Correo del usuario',
  `Contrasena` varchar(30) NOT NULL COMMENT 'Contraseña del usuario',
  `Fecha_Registro` date NOT NULL COMMENT 'Fecha en que se registró el usuario',
  `Activo` bit(1) DEFAULT b'1' COMMENT 'Si el usuario sigue activo (1) o fue dado de baja (0)',
  PRIMARY KEY (`Id_Usuario`),
